/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `customer_order_item_AFTER_INSERT` AFTER INSERT ON `customer_order_item` FOR EACH ROW BEGIN
	UPDATE customer_bill cb
    INNER JOIN customer_order co 
		ON cb.user_bill_ID = co.user_bill_ID
    INNER JOIN customer_order_item coi 
