/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `supplier_order_item_AFTER_INSERT` AFTER INSERT ON `supplier_order_item` FOR EACH ROW BEGIN
	UPDATE supplier_bill sb
    INNER JOIN supplier_order so 
		ON sb.supplier_bill_ID = so.supplier_bill_ID
    INNER JOIN supplier_order_item soi 
		ON so.supplier_order_ID = soi.supplier_order_ID
    SET subtotal = subtotal + NEW.item_price
    WHERE sb.supplier_bill_ID = (SELECT supplier_bill_ID FROM supplier_order
							 WHERE supplier_order_ID = NEW.supplier_order_ID);   
    
END */;;
